import React from "react";

export default function TextForm() {
  return (
    <div className="container">
      <div className="mb-3 text-center">
        <label
          for="mybox"
          className="form-label display-6 fw-normal "
        >
          Example textarea
        </label>
        <textarea
          className="form-control"
          id="mybox"
          rows="8"
        ></textarea>
      </div>
    </div>
  );
}
